import Drink from "./Drink";

export default function DrinkList({drinks}){
  console.log(drinks)
  return(
    <div>
      <h2>Drinks</h2>
      <ul>
        {drinks.map(drink => (
          <Drink 
            key={drink.id}
            name={drink.name}
            glass={drink.glass}
            instructions_en={drink.instructions_en}
            ingredient1={drink.ingredient1}
            measure1={drink.measure1}
          />
        )

        )}
      </ul>
    </div>
  )
}
